let Comp = new Lib(
    ()=>{
        let x = useSelector<IStore,any>(stroe=>stroe.isLogin)

        return <div> BANANA </div>
    }
).GetComp();



const App =()=>{
    let store = useStore();

    useEffectV2("app",()=>{
        Start_With_Token(store);
        Force_Logout(store);
        Get_All_Setting(store)
    })

    return(
        <>
            <Comp/>
            {/* <Guest/>
            <Game/>  */}
        </>
    )
}
export default App
